layer_gcode.3.0.0:
{if layer_num == 1}
   M221 D0 S100
   M221 D1 S100
   {if is_extruder_used[0]}
      M568 P0 S{temperature[0]} R{temperature[0]+ standby_temperature_delta}
   {endif}
   {if is_extruder_used[1]}
      M568 P1 S{temperature[1]} R{temperature[1]+ standby_temperature_delta}
   {endif}
{endif}

start_gcode.3.0.0:
T-1 P0                                             ; deselect tools
G1 X60 Y-5 Z80                                     ; move extruder 0 above bed;
;
M568 P0 S{first_layer_temperature[0]} R{first_layer_temperature[1]+ 1.5 * standby_temperature_delta} A1
M568 P1 S{first_layer_temperature[1]} R{first_layer_temperature[1]+ standby_temperature_delta} A1
;
M140 S[first_layer_bed_temperature]                ; set bed temerature
M190 S[first_layer_bed_temperature]                ; wait for bed temperature
;
G29                                                ; mesh bed leveling using defined mesh grid
G90                                                ; absolute positioning
;
G1 X0 Y-5 Z0.6                                     ; move extruder near bed
;
M568 P0 S{first_layer_temperature[0]} R{first_layer_temperature[1]+ standby_temperature_delta} A1
;
T0 P0                                              ; select tool 0
M116 P0                                            ; wait for tool 0 temperature
M98 P"0:/sys/primeLine-X.g"                        ; execute primeline macro for x
G1 X-125 Z5                                        ; move tool 0 to parking position
;
T1 P1                                              ; select tool 1
M116 P1                                            ; wait for tool 1 temperature
G1 X252 Y-5 Z0.6                                   ; move extruder near bed
M98 P"0:/sys/primeLine-U.g"                        ; execute primeline macro macro for u
;
{if initial_extruder != 1}   
   G1 U365 Z5                                      ; move tool 1 to parking position
{endif}
;
T2
